import React, { Component } from 'react'
import { connect } from 'react-redux'

class demo extends Component {
    render() {
        return (
            <div>
            <h2>Articles</h2>
                  {this.props.count}

            </div>
        )
    }
}

const mapStateToProps = (state) => ({
    count : state.count
})

export default connect(mapStateToProps)(demo);
